object Maraton {
    tailrec fun solve(participant: List<String>, completion: List<String>, solution: String): String =
            when {
                solution.isNotEmpty() -> solution
                completion.isEmpty() -> participant.last()
                else -> {
                    val part = participant[0]
                    val compl = completion[0]

                    if (part != compl) {
                        solve(emptyList(), emptyList(), part)
                    } else {
                        solve(participant.drop(1), completion.drop(1), "")
                    }

                }
            }


    tailrec fun solve1(participant: List<String>, completion: List<String>): List<String> = when {
        completion.isEmpty() -> participant
        else -> {
            val head = completion.first()
            val temp1 = participant.takeWhile { it != head }
            val temp2 = participant.takeLast(participant.size - temp1.size - 1)
            solve1(temp1 + temp2, completion.drop(1))
        }
    }
}

